import React, { useEffect,useState } from "react";
import { userType } from "../atoms";
import { useSetRecoilState ,useRecoilState} from 'recoil'


export function NurseSchedule () {
    const [timeSlot, setTimeSlot] = useState([]);

    const [yourTimeSlot, setYourTimeSlot] = useState([]);

    const [userinfo, setUserinfo] = useRecoilState(userType);

    var myHeader = new Headers();
    myHeader.append("Access-Control-Allow-Origin", "*");

    var myHeaders = new Headers();
    myHeaders.append("Access-Control-Allow-Origin", "*");
    myHeaders.append("Content-Type", "application/json");

    var requestOption = {
        method: 'GET',
        headers: myHeader,
        mode: 'cors',
        redirect: 'follow'
      };

const youTimeSlot=()=>{

    const nurse_id={"id":userinfo["nurse_id"]}
    console.log(nurse_id)
    var requestOptions = {
        method: 'POST',
        headers: myHeaders,
        mode: 'cors',
        redirect: 'follow',
        body: JSON.stringify( nurse_id )  
      };
    fetch("http://localhost:3000/nurseTimeSlots", requestOptions)
    .then(response => response.json())
    .then(result => {setYourTimeSlot(result) ;console.log(result)
  })
    .catch(error => console.log('error', error));
}

    useEffect(() => {
        fetch("http://localhost:3000/timeSlot", requestOption)
          .then(response => response.json())
          .then(result => {setTimeSlot(result) ;console.log(result)
        })
          .catch(error => console.log('error', error));
          youTimeSlot(userinfo["nurse_id"])
        }, []);

const insertNurseTimeSlotScheduleTable=(timeSlot)=>{

    console.log(timeSlot,timeSlot["time_slot_id"],userinfo[0]["nurse_id"])
    var data_send={}
    data_send["time_slot_id"]=timeSlot["time_slot_id"]
    data_send["nurse_id"]=userinfo[0]["nurse_id"]

    console.log(data_send)

    var requestOptions = {
        method: 'POST',
        headers: myHeaders,
        mode: 'cors',
        redirect: 'follow',
        body: JSON.stringify( data_send )  
      };

      fetch("http://localhost:3000/insertNurseTimeSlotScheduleTable", requestOptions)
      .then(response => response.json())
      .then(result => {console.log(result)
    })
      .catch(error => console.log('error', error));

}

    return(<>
    <div class="flex items-center justify-center p-12">

    <div class="relative overflow-x-auto shadow-md sm:rounded-lg">
    <table class="w-full text-sm text-left rtl:text-right text-gray-500 dark:text-gray-400">
        <thead class="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400">
            <tr>
                <th scope="col" class="px-6 py-3">
                    Date
                </th>
                <th scope="col" class="px-6 py-3">
                    Time
                </th>
                <th scope="col" class="px-6 py-3">
                    Max Capacity
                </th>

            </tr>
        </thead>
        <tbody>

        {timeSlot.map((time) => 
            <tr class="bg-white border-b dark:bg-gray-800 dark:border-gray-700">
                <th scope="row" class="px-6 py-4 font-medium text-gray-900 whitespace-nowrap dark:text-white">
                    {time["date"]} 
                </th>
                <td class="px-6 py-4">
                    {time["start_time"]}
                </td>
                <td class="px-6 py-4">
                    {time["max_capacity"]}
                </td>


                <td class="px-6 py-4">
                    <button onClick={()=>{insertNurseTimeSlotScheduleTable(time)}} class="font-medium text-blue-600 dark:text-blue-500 hover:underline">Select</button>
                </td>
            </tr>
            )}

        </tbody>
    </table>
</div>


<div class="m-5"></div>
    <h4 class="text-2xl font-bold dark:text-white">Your Time Slots</h4>

    <div class="relative overflow-x-auto shadow-md sm:rounded-lg">
    <table class="w-full text-sm text-left rtl:text-right text-gray-500 dark:text-gray-400">
        <thead class="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400">
            <tr>
                <th scope="col" class="px-6 py-3">
                    Date
                </th>
                <th scope="col" class="px-6 py-3">
                    Time
                </th>
                <th scope="col" class="px-6 py-3">
                    Max Capacity
                </th>

            </tr>
        </thead>
        <tbody>

        {yourTimeSlot.map((time) => 
            <tr class="bg-white border-b dark:bg-gray-800 dark:border-gray-700">
                <th scope="row" class="px-6 py-4 font-medium text-gray-900 whitespace-nowrap dark:text-white">
                    {time["date"]} 
                </th>
                <td class="px-6 py-4">
                    {time["start_time"]}
                </td>
                <td class="px-6 py-4">
                    {time["max_capacity"]}
                </td>


                <td class="px-6 py-4">
                    <button onClick={()=>{}} class="font-medium text-blue-600 dark:text-blue-500 hover:underline">Delete</button>
                </td>
            </tr>
            )}

        </tbody>
    </table>
</div>


</div>
    </>)}
